import './App.css';
import Main from './component/Main';
import Login from './component/Login';
import Game from './component/Game'
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
function App() {
  return (




    <BrowserRouter>
        <Route path="/" component={Main } />
        <Route path="login" component={Login } />
    </BrowserRouter>
)}

export default App;
